import React from 'react';
import ProjectCard from '../components/ProjectCard';
import './Portfolio.css';

const Portfolio = () => {
  const projects = [
    { id: 1, title: 'Project 1', image: 'project1.jpg', description: 'Description of Project 1', link: '#' },
    { id: 2, title: 'Project 2', image: 'project2.jpg', description: 'Description of Project 2', link: '#' },
  ];

  return (
    <div className="portfolio">
      <div className="filter-section">
        <button>UX</button>
        <button>React</button>
        <button>Angular</button>
        <button>HTML</button>
      </div>
      <div className="project-list">
        {projects.map((project, index) => (
          <ProjectCard key={project.id} project={project} isAlternate={index % 2 !== 0} />
        ))}
      </div>
    </div>
  );
};

export default Portfolio;
